    console.log("mounted")
    db.collection('analysixs')
    .get()
    .then ( snapshot => {
        console.log(snapshot)
    })
    .catch( error => console.log(error))
}

const Render = () => {

    renderFeed()

    return (
        <div className='bg-gray-100'>Post
            <div className='border bg-white p-2 border-gray-300 leading-normal text-lg font-medium'>
